import styled from "styled-components";

const HeaderStyled = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-around;
  position: relative;

  background-color: #f5f6fa;
  height: 4em;
  border-bottom: 1px solid #dcdde1;
`;

export default HeaderStyled;
